" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Mammographic occult breast cancer",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 350px; height: 582px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A dense breast can obscure a cancer. CC and MLO views (panels A and B) in a woman with a palpable breast lump show dense breast parenchyma. No discrete mass or calcifications are seen. An MRI with contrast (panel C) in the same breast shows multiple enhancing masses (arrows) involving the upper half of the breast worrisome for malignancy. If there is a clinical suspicion for cancer, a negative mammogram should not stop further intervention.",
"    <div class=\"footnotes\">",
"     CC: craniocaudal; MLO: mediolateral oblique.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
