var title_f39_4_40012="Treatment of nongenital mucocutaneous candidiasis for adults";
var content_f39_4_40012=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F86676&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F86676&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Treatment of nongenital mucocutaneous candidiasis for adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Condition",
"       </td>",
"       <td class=\"subtitle1\">",
"        Primary",
"       </td>",
"       <td class=\"subtitle1\">",
"        Alternatives for fluconazole-refractory disease",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Oropharyngeal",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Mild:",
"         </strong>",
"         Clotrimazole troches 10 mg orally five times daily;",
"         <strong>",
"          or",
"         </strong>",
"        </p>",
"        <p>",
"         Nystatin suspension or pastilles 400,000 to 600,000 units orally four times daily",
"        </p>",
"        <strong>",
"         Moderate to severe or unresponsive to local treatment:",
"        </strong>",
"        Oralfluconazole 200 mg on day one then 100 to 200 mg orally daily",
"       </td>",
"       <td>",
"        <p>",
"         Itraconazole oral solution 200 mg daily;",
"         <strong>",
"          or",
"         </strong>",
"        </p>",
"        <p>",
"         Posaconazole oral suspension 400 mg two times daily for three days then 400 mg daily;",
"         <strong>",
"          or",
"         </strong>",
"        </p>",
"        <p>",
"         Voriconazole 200 mg orally twice daily;",
"         <strong>",
"          or",
"         </strong>",
"        </p>",
"        <p>",
"         Amphotericin B oral suspension",
"         <sup>",
"          &bull;",
"         </sup>",
"         100 mg four times daily;",
"         <strong>",
"          or",
"         </strong>",
"        </p>",
"        IV echinocandin or amphotericin B deoxycholate 0.3 mg/kg daily",
"       </td>",
"       <td>",
"        Oral fluconazole is recommended for moderate to severe disease, and topical therapy with clotrimazole or nystatin is recommended for mild disease. Treat uncomplicated disease for 7 to 14 days. For refractory disease an oral suspension of itraconazole, posaconazole, voriconazole, or amphotericin B",
"        <sup>",
"         &bull;",
"        </sup>",
"        is recommended.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Esophageal",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         Fluconazole 400 mg orally on day one then 200 to 400 mg (3 to 6 mg/kg) orally daily;",
"         <strong>",
"          or",
"         </strong>",
"        </p>",
"        <p>",
"         An IV echinocandin*;",
"         <strong>",
"          or",
"         </strong>",
"        </p>",
"        Amphotericin B deoxycholate 0.3 to 0.7 mg/kg IV daily",
"       </td>",
"       <td>",
"        <p>",
"         Itraconazole oral solution 200 mg daily;",
"         <strong>",
"          or",
"         </strong>",
"        </p>",
"        <p>",
"         Posaconazole oral suspension 400 mg twice daily;",
"         <strong>",
"          or",
"         </strong>",
"        </p>",
"        Voriconazole 200 mg orally or IV twice daily",
"       </td>",
"       <td>",
"        Oral fluconazole is preferred. For patients unable to tolerate an oral agent one of the following intravenous agents is appropriate: fluconazole, an echinocandin*, or amphotericin B deoxycholate. Treat for 14 to 21 days. For patients with refractory disease, the alternative therapy as listed or intravenous amphotericin B deoxycholate or an echinocandin* is recommended.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Echinocandin dosing in adults is as follows: anidulafungin 100 mg IV loading dose on day one, then 50 mg IV daily thereafter; or caspofungin 50 mg IV per day (no loading dose required); or micafungin 100 to 150 mg IV per day (no loading dose required).",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Amphotericin B oral suspension is not a commercially available product in the United States.",
"     <br/>",
"     &Delta; Esophageal candidiasis requires systemic antifungal therapy.",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Pappas PG, Kauffman CA, Andes D, et al. Clinical practice guidelines for the management of candidiasis: 2009 update by the Infections Diseases Society of America. Clin Infect Dis 2009; 48:503.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
